import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the first product card using a unique selector (product title text)
    // We'll use XPath to find the first occurrence of a product title from the data.js mock
    const firstProductTitle = "Apple iPhone 15 Pro Max, 256GB, Natural Titanium";
    const productCardXPath = `//h3[contains(@class, 'product-title') and normalize-space(text())="${firstProductTitle}"]/ancestor::div[contains(@class, 'product-card')]`;
    await page.waitForSelector(`xpath=${productCardXPath}`, { timeout: 5000 });

    // Take screenshot of the first product card
    const productCardElem = await page.$(`xpath=${productCardXPath}`);
    if (productCardElem) {
      const productCardShot = path.join(screenshotsDir, 'step_2_product_card.png');
      await productCardElem.screenshot({ path: productCardShot });
      screenshots.push(productCardShot);
    }

    // Find the "Add to Cart" button inside the first product card (use button text and class)
    const addToCartBtn = await productCardElem.$(`.//button[contains(@class, 'add-to-cart') and contains(text(), 'Add to Cart')]`);
    if (!addToCartBtn) throw new Error('Add to Cart button not found in first product card');

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Wait for notification (success) to appear (class: .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const afterAddShot = path.join(screenshotsDir, 'step_3_after_add.png');
    await page.screenshot({ path: afterAddShot });
    screenshots.push(afterAddShot);

    // Extract cart count from the cart counter element (should increment to 1)
    // The cart count is in element with id="cartCount"
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Open the cart modal by clicking the cart area (class: .cart)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear (id="cartModal")
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of the cart modal
    const cartModalShot = path.join(screenshotsDir, 'step_4_cart_modal.png');
    await page.screenshot({ path: cartModalShot });
    screenshots.push(cartModalShot);

    // Extract the product title from the cart modal to verify the correct product was added
    // Cart items are in class .cart-item-title inside #cartModal
    const cartProductTitles = await page.$$eval('#cartModal .cart-item-title', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Added the first product to cart and verified cart contents",
      extractedData: {
        cartCount: cartCountText,
        cartProductTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
